(46, 'TRẦM VỤN HƯƠNG PHAI', '60 phút/1 tập', 'NỘI DUNG PHIM\r\nTrầm Vụn Hương Phai kể về Nhan Đàm vốn là một hoa sen tinh từ thời thượng cổ, toàn thân đều là dược liệu quý giá nhất, bởi vì trong buổi thịnh yến của Vương mẫu Nhan Đàm và tỷ muội sinh đôi Chỉ Tích của mình hóa thành hình người trước thời hạn 100 năm cho nên đã gặp kiếp nạn lớn nhất đời mình - tình kiếp. Nhan Đàm vốn dĩ muốn dùng một nửa trái tim của bản thân để đổi lấy chân tình của Ứng Uyên Quân thế nhưng không ngờ Ứng Uyên lại quên mất cô ấy. Dư Mặc là ngư tinh từ thời thượng cổ đã quen với những câu chuyện của Nhan Đạm cho nên đem chính mình hòa vào câu chuyện của cô ấy, vì tìm Nhan Đàm, Dư Mặc không ngại cởi bỏ tiên cách hóa yêu, Dư Mặc đã trở thành nơi ký thác mạnh mẽ để Nhan Đàm bắt đầu lại cuộc sống.\r\n\r\nỞ núi Gia Lan, hai người họ cùng nhau sống yên bình, vì để bản thân mạnh hơn mà Dư Mặc thường mang Nhan Đàm đi \"mỗi ngày làm một việc thiện\", xử lý những kẻ ác. Lúc này Nham Đàm đã gặp lại Đường Châu - là chuyển kiếp của Ứng Uyên đế quân, kiếp này Ứng Uyên là trừ yêu sư Đường Châu. Những ngày sau đó Đường Châu và Nham Đàm trải qua những ngày sống dưới phàm trần, không chỉ đấu trí với nhau mà còn cùng nhau trải qua nhiều hoạn nạn, trong lúc Nhan Đàm giúp Đường Châu tìm lại bốn món thần khí thượng cổ đồng thời cũng phát hiện ra từ bí ẩn này đến bí ẩn khác. Cuối cùng, thần khí đã tìm về được hết, đế quân cũng trở về vị trí cũ, mà giờ phút này Nhan Đàm cũng đã phát hiện ra nơi mình thuộc về.', 1, 'importal8206.jpg', 'tram-vun-huong-phai', 11, 'phimbo', 8, 1, 1, 0, 'Immortal Samsara (2022)', 1, 0, '2022-09-22 14:51:20', '2022-09-22 14:51:20', NULL, 'xem phim Trầm Vụn Hương Phai vietsub, phim Immortal Samsara vietsub, xem Trầm Vụn Hương Phai vietsub online tap 1, tap 2, tap 3, tap 4, phim Im